const OurSolarSystem= ({ planet }) => {

    return (
        <View >
            <View style={{flex: 1,flexDirection: 'row', alignItems: 'center'}}>
                <Text style={{color: 'white', fontSize: 16, backgroundColor: 'black'}}>{planet.au} {planet.name}</Text>
